import Dashboard from "./components/Test";
import Shaff from "./pages/Shaffs";
import Menu from "./pages/Menu";

const routes = [
  {
    title: "Dashboard",
    path: "/panel",
    exact: true,
    component: Dashboard,
  },
  {
    title: "Dashboard",
    path: "/panel/dashboard",
    exact: false,
    component: Dashboard,
  },
  {
    title: "Shaff",
    path: "/panel/Resturant/shaff",
    exact: false,
    component: Shaff,
  },
  {
    title: "Menu",
    path: "/panel/Resturant/menu",
    exact: false,
    component: Menu,
  },
];

export default routes;
